import './App.css';
import React, {useState} from 'react';
import axios from 'axios'

import Filter from './components/Filter'

function App() {

  const [ autocomplete, setAutocomplete ] = useState([])



  const handleNewSearch = (event) => {

    const searchName = event.target.value.toLowerCase();

    if (searchName === '') {
      return;
    }
    else {


      console.log(searchName);

      axios
        .get(`http://localhost:3001/autocomplete/${searchName}`)
        .then(response => {
          console.log('promis fulfilded');
          const predictions = response.data.predictions
          setAutocomplete(response.data)
          for (term of predictions) {
            console.log(term.description);
          }

        })
        .catch(error => {
          console.log("bad promise");
        })
    }



  }

  return (
    <div>
      <h3>{autocomplete[0]}</h3>

      <Filter handleNewSearch={handleNewSearch}/>


    </div>
  );
}

export default App;
